import React from "react";
import Netflix from "./Netflix";
import Amazon from "./Amazon";

const favseries = "amazon";

const FavS = () => {
  if (favseries === "netflix") {
    return <Netflix />;
  } else {
    return <Amazon />;
  }
};

const App = () => (
  <>
    <h1 className="heading_style"> List of top 5 Netflix Series in 2024</h1>
    <FavS />
  </>
);

export default App;
